import { Box, Typography } from "@mui/material";
import React, { useEffect, useState } from "react";

function AppBorneMulhouse1() {
  const [dataBorne, setDataBorne] = useState();

  useEffect(() => {
    fetch(`http://151.80.137.77:1880/mulhouse/borne_1/login/data_borne.json`, {
      method: "GET",
    }).then((response) =>
      response.json().then((dataBorne) => setDataBorne(dataBorne))
    );
  }, []);

  return (
    <>
      <Box>
        <Typography variant="h2">Borne 1 - Mulhouse</Typography>
      </Box>

      <Box>
        <Typography>{dataBorne}</Typography>
      </Box>
    </>
  );
}

export default AppBorneMulhouse1;
